func testAccountToOnePartyUsingID(t *testing.T) {
	tx := MustTx(boil.Begin())
	defer tx.Rollback()

	var local Account
	var foreign Party

	seed := randomize.NewSeed()
	if err := randomize.Struct(seed, &local, accountDBTypes, true, accountColumnsWithDefault...); err != nil {
		t.Errorf("Unable to randomize Account struct: %s", err)
	}
	if err := randomize.Struct(seed, &foreign, partyDBTypes, true, partyColumnsWithDefault...); err != nil {
		t.Errorf("Unable to randomize Party struct: %s", err)
	}

	if err := foreign.Insert(tx); err != nil {
		t.Fatal(err)
	}

	local.ID = foreign.ID
	if err := local.Insert(tx); err != nil {
		t.Fatal(err)
	}

	check, err := local.IDByFk(tx).One()
	if err != nil {
		t.Fatal(err)
	}

	if check.ID != foreign.ID {
		t.Errorf("want: %v, got %v", foreign.ID, check.ID)
	}

	slice := AccountSlice{&local}
	if err = local.L.LoadID(tx, false, &slice); err != nil {
		t.Fatal(err)
	}
	if local.R.ID == nil {
		t.Error("struct should have been eager loaded")
	}

	local.R.ID = nil
	if err = local.L.LoadID(tx, true, &local); err != nil {
		t.Fatal(err)
	}
	if local.R.ID == nil {
		t.Error("struct should have been eager loaded")
	}
}

